pragma solidity ^0.4.24;

import "../node_modules/openzeppelin-solidity/contracts/token/ERC20/StandardToken.sol";

import "./DuperToken.sol";
import "./SuperToken.sol";

contract TokenBank  {

    struct Token {
        uint256 index;
        StandardToken token;
    }

    address[] public _acceptedTokens;

    SuperToken private _t1;

    constructor() public {
        _t1 = new SuperToken();
        _acceptedTokens.push(_t1);
    }

    function checkSupply() public view returns (uint256) {    
        return _t1.totalSupply();
    }
}
